description:
Week two was rolling with some special guests on I AM ATHLETE Tonight. Dez Bryant is seeking a return to the league, and has his eyes set on one team in the desert. Undefeated boxing champion Shakur Stevenson isn't ducking anybody for a fight. The crew also reacts to Antonio Brown's comments against Colin Kaepernick.

